import React, { useState } from 'react';
import './DamageAssessment.css';

const DamageAssessment = ({ imageData, scanResults }) => {
  const [assessment, setAssessment] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleAssessDamage = async () => {
    if (!imageData) {
      setError('No image data available for assessment');
      return;
    }

    setIsLoading(true);
    setError(null);

    try {
      // Convert imageData to blob if it's a data URL
      let imageBlob;
      if (typeof imageData === 'string' && imageData.startsWith('data:')) {
        const response = await fetch(imageData);
        imageBlob = await response.blob();
      } else if (imageData instanceof Blob) {
        imageBlob = imageData;
      } else {
        throw new Error('Invalid image data format');
      }

      // Create form data
      const formData = new FormData();
      formData.append('file', imageBlob, 'image.jpg');

      // Call damage assessment API
      const response = await fetch('http://localhost:8000/api/damage-assessment', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`Assessment failed: ${response.statusText}`);
      }

      const result = await response.json();
      setAssessment(result);

    } catch (err) {
      console.error('Damage assessment error:', err);
      setError(err.message || 'Failed to assess bill damage');
    } finally {
      setIsLoading(false);
    }
  };

  const getConditionIcon = (condition) => {
    switch (condition) {
      case 'fit':
        return '‚úÖ';
      case 'unfit':
        return '‚ùå';
      case 'mutilated':
        return '‚ö†Ô∏è';
      case 'doubtful':
        return '‚ùì';
      default:
        return 'üîç';
    }
  };

  const getConditionColor = (condition) => {
    switch (condition) {
      case 'fit':
        return 'success';
      case 'unfit':
        return 'error';
      case 'mutilated':
        return 'error';
      case 'doubtful':
        return 'warning';
      default:
        return 'info';
    }
  };

  const getUsabilityText = (usability) => {
    switch (usability) {
      case 'can_use':
        return 'Safe to use in transactions';
      case 'cannot_use':
        return 'Should not be used - exchange required';
      case 'verify_manually':
        return 'Manual verification recommended';
      default:
        return 'Assessment needed';
    }
  };

  if (error && !assessment) {
    return (
      <div className="damage-assessment error">
        <h3>üîß AI Damage Assessment</h3>
        <div className="assessment-error">
          <p>Assessment service temporarily unavailable</p>
          <p className="error-detail">{error}</p>
          <button 
            onClick={handleAssessDamage}
            className="btn btn-secondary retry-btn"
          >
            Retry Assessment
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="damage-assessment">
      <div className="assessment-header">
        <h3>üîß AI Damage Assessment</h3>
        <p className="assessment-subtitle">Physical condition analysis using GPT-5 AI</p>
      </div>

      {!assessment && !isLoading && (
        <div className="assessment-prompt">
          <p>Get detailed damage analysis and BSP fitness evaluation</p>
          <button 
            onClick={handleAssessDamage}
            className="btn btn-primary assess-btn"
          >
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M9 12l2 2 4-4" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
              <circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2" fill="none"/>
            </svg>
            Assess Bill Condition
          </button>
        </div>
      )}

      {isLoading && (
        <div className="assessment-loading">
          <div className="loading-spinner"></div>
          <p>AI analyzing bill condition...</p>
          <small>This may take a few moments</small>
        </div>
      )}

      {assessment && (
        <div className="assessment-results">
          {/* Main Condition Status */}
          <div className={`damage-condition condition-${assessment.assessment.condition}`}>
            <div className="condition-icon">
              {getConditionIcon(assessment.assessment.condition)}
            </div>
            <div className="condition-content">
              <h4 className="condition-title">
                {assessment.assessment.condition.toUpperCase()} FOR CIRCULATION
              </h4>
              <p className="condition-subtitle">
                {getUsabilityText(assessment.assessment.usability)}
              </p>
            </div>
            <div className="fitness-score">
              <span className="score-value">{assessment.assessment.fitness_score}%</span>
              <span className="score-label">Fitness Score</span>
            </div>
          </div>

          {/* Detailed Analysis */}
          <div className="detailed-analysis">
            <h5>Detailed Analysis</h5>
            <p>{assessment.assessment.detailed_analysis}</p>
          </div>

          {/* Damage Types */}
          {assessment.assessment.damage_types.length > 0 && (
            <div className="damage-types">
              <h5>Identified Issues</h5>
              <div className="damage-tags">
                {assessment.assessment.damage_types.map((damage, index) => (
                  <span key={index} className="damage-tag">
                    {damage.replace(/_/g, ' ')}
                  </span>
                ))}
              </div>
            </div>
          )}

          {/* Recommendation */}
          <div className={`damage-recommendation ${getConditionColor(assessment.assessment.condition)}`}>
            <h5>Recommendation</h5>
            <p>{assessment.assessment.recommendation}</p>
          </div>

          {/* BSP Exchange Information */}
          {assessment.assessment.exchange_eligible && (
            <div className="exchange-info">
              <h5>üí± BSP Exchange Eligible</h5>
              <p>This bill is eligible for exchange at BSP offices.</p>
              <div className="exchange-process">
                <h6>Exchange Process:</h6>
                <ol>
                  {assessment.bsp_exchange_info.process.map((step, index) => (
                    <li key={index}>{step}</li>
                  ))}
                </ol>
              </div>
            </div>
          )}

          {/* BSP Reporting */}
          {assessment.assessment.bsp_report_required && (
            <div className="bsp-report-required">
              <h5>üìã BSP Report Required</h5>
              <p>This bill condition should be reported to BSP for official assessment.</p>
              <div className="contact-info">
                <p><strong>Hotline:</strong> {assessment.bsp_exchange_info.contact_info.hotline}</p>
                <p><strong>Email:</strong> {assessment.bsp_exchange_info.contact_info.email}</p>
              </div>
            </div>
          )}

          {/* Assessment Timestamp */}
          <div className="assessment-meta">
            <small>
              AI Assessment completed on {new Date(assessment.timestamp).toLocaleString()}
            </small>
          </div>
        </div>
      )}

      {error && assessment && (
        <div className="assessment-warning">
          <p>‚ö†Ô∏è Some assessment features may be limited: {error}</p>
        </div>
      )}
    </div>
  );
};

export default DamageAssessment;
